import logo from './logo.svg';
import './App.css';
import ImageUpload from './components/ImageUpload';

function App() {
  return (
    <div className="App">
      <h1 className="text-3xl font-bold underline">
      Classify Your Dog!
    </h1>
    <ImageUpload />
    </div>
  );
}

export default App;
